import React from 'react';
import { connect } from 'redux-bundler-react';
import ToggleButton from './toggle-button';

class Toolbar extends React.Component{
    render(){
        const { drawPoints, drawLines, drawPolygons } = this.props;
        return (
            <div className="container-fluid mt-3" style={{position:'absolute',zIndex:2}}>
                <div className="float-right">
                    <a href="/" className="btn btn-info">Go Home</a>
                </div>
                <div className="float-left">
                    <ToggleButton className="ms ms-points" interaction = {drawPoints}/>
                    <ToggleButton className="ms ms-line" interaction = {drawLines}/>
                    <ToggleButton className="ms ms-polygon" interaction = {drawPolygons}/>
                </div>
            </div>
        )
    }
}
export default connect(
    'selectDrawPoints',
    'selectDrawLines',
    'selectDrawPolygons',
    Toolbar
);
